= 0.5, aes(color = plot_type))\n","\n","ggplot(surveys_clean, mapping = aes(x = species_id, y = weight)) +\n","  geom_jitter(alpha = 0.3, color = \"tomato\") +\n"," geom_boxplot(alpha = 0)\n","\n","ggplot(surveys_clean, mapping = aes(x = species_id, y = weight)) +\n","  geom_jitter(alpha = 0.3, color = \"green\") +\n","  geom_violin(alpha = 0)\n","\n","\n","yearly_count <- surveys_clean %>% \n","  count(year, genus) %>%\n","  rename(\"genus_numbers\"= n) %>% \n","  arrange(year, desc(genus_numbers))\n","\n","view(yearly_count)\n","\n","\n","ggplot(yearly_count, mapping = aes(year, genus_numbers, group = genus)) +\n","  geom_line(aes(color = genus))  #group is introduced here  so that the line is drawn for eac group of genera\n","\n","\n","ggplot(yearly_count, mapping = aes(year, genus_numbers, color = genus)) +\n","  geom_line() +\n","  facet_wrap(facets = vars(genus))\n","  \n","yearly_sex_count <- surveys_clean %>% \n","  count(year, genus, sex) %>%\n","  rename(\"genus_numbers\"= n)\n","\n","\n","ggplot(yearly_sex_count, mapping = aes(year, genus_numbers, color = sex)) +\n","  geom_line() +\n","  facet_wrap(facets = vars(genus))\n","\n","        \n","        \n","\n","\n","ggplot(yearly_sex_count, mapping = aes(year, genus_numbers, color = sex)) +\n","  geom_line() +\n","  facet_grid(rows = vars(sex), cols = vars(genus)) + \n","  labs(title = \"Observed Genera Through Sex\",\n","       x = \"Year of Observation\",\n","       y = \"Number of Individuals\")\n","\n","\n","ggplot(yearly_sex_count, mapping = aes(year, genus_numbers, color = sex)) +\n","  geom_line() +\n","  facet_grid(rows = vars(genus)) + \n","  labs(title = \"Observed Genera Through Sex\",\n","       x = \"Year of Observation\",\n","       y = \"Number of Individuals\")\n","\n","ggplot(yearly_sex_count, mapping = aes(year, genus_numbers, color = sex)) +\n","  geom_line() +\n","  facet_grid(cols = vars(genus)) + \n","  labs(title = \"Observed Genera Through Time\",\n","       x = \"Year of Observation\",\n","       y = \"Number of Individuals\") +\n","  theme_bw() \n","\n","#how does average weight of each species change over the years\n","\n","average_weight_year <- surveys_clean %>% \n","  group_by(year, species_id) %>% \n","  summarize(mean_weight = mean(weight))\n","\n","view(average_weight_year)\n","\n","\n","\n","\n","plot_weight <- ggplot(surveys_clean, aes(species_id, weight)) +\n","  geom_boxplot() +\n","  labs(x = \"Species\", y = expression(log[10](weight))) + \n","  scale_y_log10()\n","\n","\n","plot_count <- ggplot(data = yearly_count, aes(x = year, y = genus_numbers, color = genus)) +\n","  geom_line() +\n","  labs(x = \"Year\", y = \"Abundance\")\n","\n","plot_weight / plot_count + plot_layout(heights = c(3, 2))\n","\n","#Exporting plots\n","\n","plot_combined <- plot_weight / plot_count + plot_layout(heights = c(3, 2))\n","ggsave(\"plot_combined.png\", plot_combined, width = 10, dpi = 300)\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":67.333264,"end_time":"2021-12-26T00:16:17.99714","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2021-12-26T00:15:10.663876","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}